const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    {/* <App /> */}
    <StarRating maxRating={5} />
    <StarRating maxRating={10} size={24} color="red" className="test" />
    <StarRating />
  </React.StrictMode>
);
